pragma solidity ^ 0.4.25;

import './Interfaces.sol';

library SafeMath {

    function add(uint256 a, uint256 b) internal pure returns (uint256 c) {
        c = a + b;
        require(c >= a, "SafeMath: err1");
    }

    function sub(uint256 a, uint256 b) internal pure returns (uint256 c) {
        require(b <= a, "SafeMath: err2");
        c = a - b;
    }

    function mul(uint256 a, uint256 b) internal pure returns (uint256 c) {
        c = a * b;
        require(a == 0 || c / a == b, "SafeMath: err3");
    }

    function div(uint256 a, uint256 b) internal pure returns (uint256 c) {
        require(b > 0, "SafeMath: err4");
        c = a / b;
    }
}

library AddressUtils {

  /**
   * Returns whether the target address is a contract
   * @dev This function will return false if invoked during the constructor of a contract,
   * as the code is not actually created until after the constructor finishes.
   * @param _addr address to check
   * @return whether the target address is a contract
   */
  function isContract(address _addr) internal view returns (bool) {
    uint256 size;
    // XXX Currently there is no better way to check if there is a contract in an address
    // than to check the size of the code at that address.
    // See https://ethereum.stackexchange.com/a/14016/36603
    // for more details about how this works.
    // TODO Check this again before the Serenity release, because all addresses will be
    // contracts then.
    // solium-disable-next-line security/no-inline-assembly
    assembly { size := extcodesize(_addr) }
    return size > 0;
  }

}

library ByteModifier {

    function bSet(uint256 _data, uint256 _value, uint256 _shift, uint256 _size) internal pure returns(uint256) {
        require(_value <= _size, "ByteModifier: err1");
        return (_data & ( 0xFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF^(_size << _shift) )) 
            | (_value << _shift);
    }

    function bGet(uint256 _data, uint256 _shift, uint256 _size) internal pure returns(uint256) {
        return (_data >> _shift) & _size;
    }

    function bAdd(uint256 _data, uint256 _value, uint256 _shift, uint256 _size) internal pure returns(uint256) {
        require( ((_data >> _shift) & _size) + _value <= _size, "ByteModifier: err2");
        return _data + (_value << _shift);
    }

    function bSub(uint256 _data, uint256 _value, uint256 _shift, uint256 _size) internal pure returns(uint256) {
        require( ((_data >> _shift) & _size) >= _value, "ByteModifier: err3");
        return _data - (_value << _shift);
    }

}

